(1, 'BriefInfo', 0, '慧目堂简介', '<p>&nbsp;</p>\r\n<p><img src="http://www.3e-d.com/js/kindeditor/attached/image/20170811/20170811072414_56929.jpg" alt="" data-ke-src="/js/kindeditor/attached/image/20170811/20170811072414_56929.jpg" /></p>\r\n<p>&nbsp;</p>\r\n<p>3EYES 慧目堂是全国知名的国际化品牌咨询公司，近14年的实战，将品牌战略与创意设计融会贯通，以&ldquo;战略定位+视觉锤&rdquo;为核心，&ldquo;品牌创建三极体系&rdquo;为系统方法，制造了一系列市场传奇，打造了数十个细分领域的领军品牌。&nbsp;</p>\r\n<p>与法国创意集团、英国Piano、意大利online等多个著名国际公司携手。运用国际先进理念和品质管理，将中华文化与国际潮流融合，创造品牌溢价。提供：调研、定位、命名；CI/VI、SI、形象、环境、导向、标识、造型、包装、店面；及网络、物料、推广、广告、活动等全面的品牌整合全案策划设计服务。</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.3e-d.com/js/kindeditor/attached/image/20170923/20170923044802_95174.jpg" alt="" data-ke-src="/js/kindeditor/attached/image/20170923/20170923044802_95174.jpg" /></p>\r\n<p>3EYES BRAND | 慧目堂品牌顾问 是创建、更新和推广品牌的专家。已成功创建上百个卓越品牌，协助客户成为行业先锋。帮助数百个品牌重获新生，实现企业盈利飞跃。&nbsp;<br />&nbsp;<br />3EYES SHOPS | 慧目堂店面空间 是营造独特空间氛围的专家。为各类品牌、商业地产、园区、写字楼酒店等创作了一系列高水准的SI店面设计、商业空间、指示设计等。&nbsp;<br />&nbsp;<br />3EYES PACKAGE | 慧目堂商品包装 是优秀的商品包装设计专家。在结构，材质，工艺等方面深入研究，不断创新。焕发包装的独特魅力，达成最直接的销售业绩。</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.3e-d.com/js/kindeditor/attached/image/20170923/20170923044856_98152.jpg" alt="" data-ke-src="/js/kindeditor/attached/image/20170923/20170923044856_98152.jpg" /></p>\r\n<p>&nbsp;</p>\r\n<p>3EYES ，cooperated with the world famous international company-GPC, is reputed as one of first-class Ideas Creation company.Applying with the advanced idea and quality management and combined the Chinese culture with the international trend fusion, we declare that the first is the strategy and the core is the market&nbsp; create high added value for our clients and meanwhile povided the other service: research, position, naming, CI/VI, environment, signage, product, packaging, and stores, network, materials, promotion and comprehensive brand integration services.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="white-space: normal;">&nbsp;</p>\r\n<p style="white-space: normal;">3EYES BRAND ，it is the experts to create, update and promote the BRAND . We successfully created hundreds of excellent brands and help our customers rank as the leader in the industry and make hundreds of brand britghten the new life and widen enterprise profit greatly.</p>\r\n<p style="white-space: normal;">&nbsp;</p>\r\n<p style="white-space: normal;">3EYES SHOPS， It work as the director to help the customer creat the unique SI shop design, commercial space and signage design for their brand, commercial real estate, industry zone, hotel and others.</p>\r\n<p style="white-space: normal;">&nbsp;</p>\r\n<p>3EYES PACKAGE，it is an excellent commodity packaging designer.By changing the structure, material, process of packagne constantly, and it help the customers create the unique eye catching packaging, which leads the successful sales of products in the market.<span style="line-height: 1.5;">&nbsp;&nbsp;</span></p>\r\n<p><span style="line-height: 1.5;">&nbsp;</span></p>\r\n<p><span style="line-height: 1.5;"><img src="http://www.3e-d.com/js/kindeditor/attached/image/20160304/20160304155442_12993.jpg" alt="" data-ke-src="/js/kindeditor/php/../attached/image/20160304/20160304155442_12993.jpg" /><br /></span></p>\r\n<p>&nbsp;</p>\r\n<p>慧目堂上海已正式入驻绿地虹桥世界中心，5A甲级创意写字楼。位于上海新门户&ldquo;虹桥商务区&rdquo;，国际企业总部正汇聚于此，充满未来的上海新门户。高铁、机场、高速、地铁10分钟即到，引领上海，环顾长三角，辐射全国乃至全球。<br />购物美食娱乐都近在咫尺，创意满满的新办公室，超大的180度弧形落地窗，让你每天的心情都好的不要不要的...坐看风和日丽，静观暴雨雷电，尽情施展智慧和努力。选择这里，我们与最优秀的企业总部为伴，开创美好未来。</p>\r\n<p>&nbsp;</p>\r\n<p>Shanghai Three Eyes Art Design Co.,Ltd removed to the Shanghai Hongqiao commercial zone- new window of shanghai and facing to Yangtze River Delta and widespread all over china mainland. &nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src="http://www.3e-d.com/js/kindeditor/attached/image/20170811/20170811072600_73530.jpg" alt="" data-ke-src="/js/kindeditor/attached/image/20170811/20170811072600_73530.jpg" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">佛有五眼，肉眼、天眼、慧眼、法眼和佛眼。正是修炼的五种境界。&nbsp;</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">其中 慧眼：是声闻（阿罗汉）、缘觉（辟支佛）的眼。能看破假相，识得真空，不被境所惑动。见众生尽，灭一异之相，舍离诸着，不受一切法，智慧自灭于内。慧眼能照见一切可见不可见、有形无形的事物。</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">慧眼功分为多眼、析眼、追眼、预眼四种类型。</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">（1）多眼是指看事物是立体的，能从四面八方多个方位看。</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">（2）析眼是指能分析，一看就知道是什么东西，有什么含义。</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">（3）追眼是指能追查过去，能够追知已经发生过的事情是什么样子，能够知道事情发生的原因。比如一只碗，追查到若干年前，看到的是哪里的一堆泥土；再如给人看病，不仅能看到病情的存在，而且能看到病史，看到以前的来龙去脉。</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">（4）预眼是指能预见未来，能把没发生的事情在将来发生时的情况看到，或者把最终的结果拿出来，用功夫还能看到事物的量变过程。</div>\r\n<div class="para" style="font-size: 14px; color: #333333; margin-bottom: 15px; text-indent: 2em; line-height: 24px; zoom: 1; font-family: arial, 宋体, sans-serif; white-space: normal;">&nbsp; ... ...水电费水电费是的<img src="http://www.3e-d.com/images/page/1_content_1534474518374227.jpg" data-file="am9bawh.file" /></div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '慧目堂，品牌策划，品牌设计，品牌策划公司', '慧目堂品牌策划公司，品牌设计公司');
